

SELECT * FROM session;

UPDATE session
	SET game_time_end = (real_time_end - real_time_start) + game_time_start
    WHERE real_time_end < real_time_start;
    
UPDATE session
	SET last_heartbeat = DATE_ADD(end, INTERVAL 30 SECOND)
    WHERE end IS NOT NULL;

UPDATE session
	SET end = DATE_ADD(start, INTERVAL (real_time_end - real_time_start) SECOND);

UPDATE session
	SET last_heartbeat = DATE_ADD(end, INTERVAL -30 SECOND);